Moxi and Malibu Barbie™ have made new colors in the life size accessory that can change your world! The Moxi Lolly now comes in a new tone of  Strawberry Pink and True Blue for you to choose from! Soak up the sun and get ready to roll! Check our Instagram story and stay tuned for more details on the Barbie Pick Up party where you can get your skates, join us in games, photos and more! 

Watch the full YouTube video now! 

VD: A IGTV video of the staff at Moxi Roller Skates coming to life as life sized Barbie dolls on a roll at Venice Beach in the new Moxi Lolly colors, Strawberry Pink & true Blue. They are wearing doll makeup, swimsuits and bright clothes & the new Strawberry pink & True Blue Moxi Lolly skates. There are tunes of La Luz playing during the video. 

